In a bloom mood 🌺 

This was an LA shoot and we depended on gorgeous weather or at least shootable weather, and it ended up POURING. James White had these gorgeous bougainvillea’s blooming all around his property so I got scrappy! We trimmed a few bushes and their color just screamed for a pairing with Prabal’s set. 

